import React from 'react';
import "./login.css"

const Login = () => {
    return (
        <div className="login">
            <form className="loginForm">
                <label>Email</label>
                <input type="text" placeholder="Enter email"/>
                <label>Password</label>
                <input type="password" placeholder="Enter password"/>
            </form>
        </div>
    );
}

export default Login;
